import {
  
  Link,
  
  
} from "react-router-dom";

export default function Categories() {
  return (
    <div>
      
        <ul>
          <li>
            <Link to="/">Home</Link>
          </li>
          <li>
            <Link to="/about">About</Link>
          </li>
          <li>
            <Link></Link>
          </li>
        </ul>
        
    </div>
  )
}
